import React from "react";
import NavBar from "./NavBar";
import Header from "./Header";
import { DUMMY_CITY } from "./homapage";
import {
  Card,
  CardBody,
  CardImg,
  CardTitle,
  CardText,
  CardImgOverlay,
} from "reactstrap";

const Home = () => {
  return (
    <div>
      <NavBar />
      <Header />
      {/* <div>{DUMMY_CITY[0].name}</div> */}
      {DUMMY_CITY.map((city) => {
        return (
          <div className="container">
            <div className="row">
              <div className="col-12 col-lg-3 m-1">
                <Card>
                  <CardImg src={city.image} width="100%" alt={city.name} />
                  <CardImgOverlay>
                    <CardTitle>{city.name}</CardTitle>
                    <CardText>{city.subText}</CardText>
                  </CardImgOverlay>
                </Card>
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Home;
